INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(1, 'Head Hunter', 'data:image/jpeg;base64,', '<div class=\"hm_text_sc\">\n                                    <h6><font color=\"#9C0000\"><span style=\"font-family: \" arial=\"\" black\";\"=\"\">Headhunter adalah</span></font> seorang atau sekelompok orang yang bertugas mencarikan kandidat bagi perusahaan-perusahaan untuk mengisi posisi midle up yang di butuhkan perusahaan/customer tersebut.</h6><h6>Headhunter memiliki kemiripan dengan outsourcing, yaitu sama-sama mencarikan karyawan untuk customer. Namun pada outsourcing, kandidat yang dicari akan menjadi karyawan perusahaan outsourcing dan mengerjakan pekerjaan customer perusahaan outsourcing tersebut, biasanya perusahaan outsourcing mengambil management fee sebesar 10 hingga 15 % dari gaji karyawan. Tapi perlu di perhatikan bahwa mangement fee di tagihkan ke customer bukan ke karyawan.</h6><h6>Sedangkan headhunter kandidat yang di carikan akan menjadi karyawan customer, umumnya perusahaan headhunter mengambil fee sebesar 23 hingga 30 % dari total gaji kandidat setahun. Sekali lagi ditekankan, baik fee maupun management fee ditagihan ke customer bukan ke kandidat atau karyawan. Jadi kandidat dan karyawan tidak perlu membayar apapun.</h6><h6>Bagi kadidat, Tidak salah sama sekali jika Anda ingin membangun relasi dengan para headhunter dari awal Anda mulai berkarir. Dengan menjalin hubungan baik dengan mereka, Anda bisa mendapatkan informasi terkini soal besaran gaji profesional di Indonesia. Selain itu Headhunter yang baik dapat menjadi pelatih atau penasihat karir Anda, dan bisa membantu Anda mengembangkan karir ke level berikutnya.</h6><h6>Sinergiadhikarya hadir untuk mensupport ke dua service tersebut yaitu mempertemukan kandidat yang bona fide dengan customer dan dapat dijadikan teman sharing buat anda yang ingin meniti karir lebih tinggi lagi.</h6>\n\n                                </div>', 'http://corporate.sinergiadhikarya.co.id/', 'head-hunter', 1, 2, '2020-06-26 20:51:55', '2020-07-04 01:17:06');
INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(2, 'Outsourcing', 'data:image/jpeg;base64,', '<h6 align=\"justify\"><font color=\"#9C0000\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Menghemat Anggaran untuk Memberikan Pelatihan</span></font></h6><h6 align=\"justify\"><span style=\"font-weight: normal;\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">Seringkali, karyawan </span><i><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">outsourcing </span></i><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">sudah memiliki keahlian \nspesifik yang dibutuhkan, seperti keahlian membersihkan atau mengorganisir barang. Perusahaan yang membutuhkan jasa karyawan</span><em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\"> outsourcing</span></em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\"> bisa menghemat anggaran untuk memberikan pelatihan<font color=\"#9C0000\">.</font></span></span></h6><h6 align=\"justify\"><span style=\"font-weight: normal;\"></span><font color=\"#9C0000\"><span style=\"font-family: \" arial=\"\" black\";\"=\"\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Mengurangi Beban Rekrutmen</span><br></span></font></h6><h6 align=\"justify\">Semua urusan seleksi karyawan outsourcing dilakukan oleh perusahaan penyedia jasa (perusahaan <i>outsourcing</i>). Sedangkan perusahaan yang membutuhkan jasa <i>outsource </i>sudah bisa mendapatkan karyawan-karyawan <i>outsource </i>terpilih dari perusahaan <i>outsourcing</i>.</h6><h6 align=\"justify\"><font color=\"#9C0000\"><span style=\"font-family: \" arial=\"\" black\";\"=\"\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Fokus Mengurus Kegiatan Inti Bisnis</span><br></span></font></h6><h6 align=\"justify\">Ketika menggunakan tenaga kerja <i>outsource</i>, perusahaan tidak perlu lagi khawatir mengenai pekerjaan teknis sehari-hari yang tidak berhubungan langsung dengan kegiatan inti bisnis.</h6><h6 align=\"justify\">Hal ini dikarenakan semuanya sudah diurus oleh tenaga kerja <i>outsource</i>, sehingga Anda tidak perlu lagi mencari tenaga kerja khusus, mengadakan training, atau mengalokasikan rekrutmen khusus untuk posisi-posisi tertentu.<span style=\"font-family: \" arial=\"\" black\";\"=\"\">﻿</span><span style=\"font-family: \" arial=\"\" black\";\"=\"\">﻿</span></h6>', 'http://corporate.sinergiadhikarya.co.id/', 'outsourcing', 1, 2, '2020-06-27 22:47:24', '2020-07-04 01:04:06');
INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(3, 'Mailroom Management', 'data:image/jpeg;base64,', '<h6><em><font color=\"#9C0000\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Mailroom</span></font> </em><span style=\"font-family: \" tahoma\";\"=\"\">s</span><span style=\"font-family: \" tahoma\";\"=\"\"><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">ering merupakan area terakhir yang diperiksa perusahaan untuk meningkatkan efisiensi dan menemukan penghematan biaya. Distribusi dan manajemen surat dan paket jarang mendapat perhatian serius, namun dapat mempengaruhi produktivitas secara nyata. Saat ini </span></span><em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">Mailroom </span></em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">mulai diperhatikan akibat banyaknya transaksi </span><em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">online</span></em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">. Memperbaiki </span><em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\">mailroom </span></em><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">Anda dapat meningkatkan bisnis dan keterlibatan karyawan Anda.</span></h6><h6><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">Banyak bisnis mengalami kesulitan saat menghitung dan mengendalikan biaya yang berhubungan dengan divisi layanan surat dan distribusi, termasuk pengiriman faks, pengemasan, kurir, dan layanan pos. Distribusi surat dan komunikasi lainnya seringkali menghabiskan waktu para karyawan serta mengganggu mereka saat melakukan tugas utamanya.</span></h6><h6><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">Menetapkan metode terbaik untuk mendistribusikan surat masuk, produk, dan paket serta mengirimkan surat membutuhkan banyak waktu keahlian yang seringkali tidak dimiliki oleh perusahaan. </span></h6><h6><span style=\"font-family: \" source=\"\" sans=\"\" pro\";\"=\"\" tahoma\";\"=\"\">Dengan memanfaatkan teknologi terkini, tim kami dapat menemukan cara yang lebih cepat dan paling efisien untuk menangani surat-surat Anda, agar produktivitas keseluruhan meningkat. Kami memiliki akses untuk menggunakan peralatan khusus yang dapat menangani surat dalam jumlah besar dan mengelola distribusinya. Teknologi ini tidak hanya dapat merekap proses surat-menyurat, namun juga mengurangi kebutuhan karyawan dan menghemat biaya operasional</span><span style=\"font-family: \" arial=\"\" black\";\"=\"\">﻿</span></h6>', 'http://corporate.sinergiadhikarya.co.id/', 'mailroom-management', 1, 2, '2020-06-30 18:23:07', '2020-07-06 19:30:37');
INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(4, 'Facility Management', 'data:image/jpeg;base64,', '<h6><font color=\"#CE0000\"><em><span style=\"font-family: \" arial=\"\" black\";\"=\"\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Facility</span><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\"> </span></span><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">management</span></em></font> merupakan gabungan beberapa fungsi manajemen terintegrasi yang dikhususkan untuk koordinasi ruang, infrastruktur, orang-orang dan organisasi. Istilah ini sering dikaitkan dengan administrasi kantor, arena, sekolah, pusat konvensi, pusat perbelanjaan, rumah sakit, hotel, dan lain-lain. Padahal fungsinya lebih luas dari sekedar layanan bisnis.</h6><h6>Dalam pelatihan <em>facility management</em> ini akan dibahas \nkronologis kegiatan dalam manajemen fasilitas meliputi \nkegiatan-kegiatan: pengadaan, penyimpanan, penggunaan, pengaturan, penyaluran, inventarisasi, pemeliharaan, rehabilitasi, dan penghapusan.</h6>', 'http://corporate.sinergiadhikarya.co.id/', 'facility-management', 1, 2, '2020-07-01 01:13:47', '2020-07-06 20:18:17');
INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(5, 'Recruitment Services', 'data:image/jpeg;base64,', '<div class=\"hm_text_sc\">\n                                    <h6><font color=\"#9C0000\"><span style=\"font-family: &quot;Arial Black&quot;;\" arial=\"\" black\";\"=\"\">Rekrutmen</span></font> adalah usaha untuk mencari dan menemukan sumber daya manusia (<em>resource</em>) untuk mengisi jabatan yang tersedia pada perusahaan.</h6><h6>Pada prosesnya, mencari dan menemukan sumber daya manusia yang sesuai tidak mudah. Perusahaan harus investasi biaya iklan, harus menseleksi sendiri data pelamar yang sangat banyak, menjadwalkan test dan interview, psikotest dan interview, kemudian menseleksi.</h6><h6><font color=\"#9C0000\"><b>Sinergiadhikarya</b></font> hadir memberikan layanan <font color=\"#9C0000\">“<strong>Jasa Rekrutmen”</strong> </font>untuk membantu anda menemukan kandidat ayng sesuai harapan anda sehingga dapat berkontribusi maksimal di perusahaan anda.</h6><h6>Dengan menggunakan layanan <font color=\"#9C0000\"><strong>jasa rekrutmen</strong></font> kami, anda\n tidak lagi perlu pusing memikirkan dan mengerjakan proses rekrutmen, anda tidak perlu lagi hawatir akan salah dalam memilih kandidat, anda bisa fokus pada core business untuk mengembangkan perusahaan anda, dan yang paling penting anda akan mendapatkan karyawan yang sesuai dengan expektasi anda dan dapat berkontribusi maskimal di perusahaan anda.</h6><h6>Kenapa harus menggunakan jasa recruitment Sinergiadhikarya ?</h6><h6><b>1. Memiliki database pelamar sendiri<br></b><b>2. Alat psikotes terbaik<br></b><b>3. Kerja sama dengan instansi pendidikan</b><br></h6>\n\n                                </div>', 'http://corporate.sinergiadhikarya.co.id/', 'recruitment-services', 1, 2, '2020-07-04 00:21:17', '2020-07-05 19:46:47');
INSERT INTO `our_services` (`id`, `name`, `based_64`, `description`, `url`, `permalink`, `isActive`, `user_id`, `created_at`, `updated_at`) VALUES
(6, 'Training Management', 'data:image/jpeg;base64,', '<p class=\"MsoNormal\"><font color=\"#9C0000\"><b style=\"mso-bidi-font-weight:normal\"><i><span style=\"font-size:12.5pt;line-height:107%;font-family:\"Segoe UI\",\"sans-serif\"\">Training\nManagement</span></i></b></font><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:12.5pt;line-height:107%;font-family:\"Segoe UI\",\"sans-serif\"\"> </span></b><span style=\"font-size:12.5pt;line-height:107%;font-family:\"Segoe UI\",\"sans-serif\"\">adalah\nmerupakan proses pelatihan terhadap karyawan baru yang direkrut oleh perusahaan\nuntuk diberikan pengarahan dan wawasan tentang profil dan unit bisnis\nperusahaan, dan diharapkan hasil dari pelatihan dan pengembangan karakter ini\nakan diperoleh dan diseleksi calon pegawai baru yang memiliki kualitas\nuntuk dipromosikan ke jenjang yang lebih strategis pada level manajemen di\nperusahaan.</span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:12.5pt;line-height:107%;font-family:\n\"Segoe UI\",\"sans-serif\"\">Salah satu program <font color=\"#9C0000\"><b style=\"mso-bidi-font-weight:\nnormal\">Training Management PT SAS</b></font> calon karyawan akan di coba berbagai\nmacam jenis kegiatan untuk  melihat kemampuan dan bakat dari masing-masing\npeserta pelatihan.</span></p>\n\n<p class=\"MsoNormal\"><span style=\"font-size:12.5pt;line-height:107%;font-family:\n\"Segoe UI\",\"sans-serif\"\">Mereka diberikan pelatihan dan pengetahuan yang\nberkaitan dengan prosedur operasional perusahaan,  keahlian perencanaan,\n pengendalian usaha, risk manajemen, dan rencana manajerial.</span></p>\n\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\nline-height:125%;mso-outline-level:3\"><font color=\"#9C0000\"><b><span style=\"font-size:14.0pt;\nline-height:125%;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n\"Times New Roman\"\">Manfaat Utama Training</span></b></font><b><span style=\"font-size:13.5pt;line-height:125%;font-family:\"Times New Roman\",\"serif\";\nmso-fareast-font-family:\"Times New Roman\"\"></span></b></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\n125%\"><span style=\"font-size:12.5pt;line-height:125%;font-family:\"Segoe UI\",\"sans-serif\";\nmso-fareast-font-family:\"Times New Roman\"\">Manfaat langsung dan dampak\npositip yang diperoleh perusahaan dengan menerapkan prosedur Training\nManagement anatara lain : </span><span style=\"font-size:12.0pt;line-height:\n125%;font-family:\"Times New Roman\",\"serif\";mso-fareast-font-family:\"Times New Roman\"\"></span></p>\n\n<ul type=\"disc\"><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Dapat menilai, mengevaluasi dan menyaring calon\n     manajerial yang berkualitas</span><span style=\"font-size:12.0pt;\n     font-family:\"Times New Roman\",\"serif\";mso-fareast-font-family:\"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Menjamin ketersediaan sumber daya manusia yang handal\n     dan trampil yang akan dipromosikan ke jenjang executive perusahaan.</span><span style=\"font-size:12.0pt;font-family:\"Times New Roman\",\"serif\";mso-fareast-font-family:\n     \"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Memberikan wawasan dan pengembangan karakter calon\n     manajerial.</span><span style=\"font-size:12.0pt;font-family:\"Times New Roman\",\"serif\";\n     mso-fareast-font-family:\"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Memberikan pelatihan tentang standar operasional\n     prosedur perusahaan yang baku.</span><span style=\"font-size:12.0pt;\n     font-family:\"Times New Roman\",\"serif\";mso-fareast-font-family:\"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Pelatihan dan Pengelolaan sumber daya manusia di\n     perusahaan</span><span style=\"font-size:12.0pt;font-family:\"Times New Roman\",\"serif\";\n     mso-fareast-font-family:\"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:125%;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;line-height:125%;font-family:\"Segoe UI\",\"sans-serif\";\n     mso-fareast-font-family:\"Times New Roman\"\">Sarana peningkatan kemampuan\n     manajemen</span><span style=\"font-size:12.0pt;line-height:125%;font-family:\n     \"Times New Roman\",\"serif\";mso-fareast-font-family:\"Times New Roman\"\"></span></li><li class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\n     line-height:normal;mso-list:l0 level1 lfo1;tab-stops:list .5in\"><span style=\"font-size:12.5pt;font-family:\"Segoe UI\",\"sans-serif\";mso-fareast-font-family:\n     \"Times New Roman\"\">Peningkatan produktifitas perusahaan </span><span style=\"font-size:12.0pt;font-family:\"Times New Roman\",\"serif\";mso-fareast-font-family:\n     \"Times New Roman\"\"></span></li></ul>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\nnormal\"><span style=\"font-size:12.0pt;font-family:\"Times New Roman\",\"serif\";\nmso-fareast-font-family:\"Times New Roman\"\"> </span></p>\n\n<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;line-height:\n125%\"><span style=\"font-size:12.5pt;line-height:125%;font-family:\"Segoe UI\",\"sans-serif\";\nmso-fareast-font-family:\"Times New Roman\"\">Proses training sangat vital\nfungsinya untuk pengembangan visi dan misi perusahaan untuk masa yang akan\ndatang, dan satu hal yang sangat penting yaitu mereka dapat bersaing di dunia\nusaha saat ini yang sangat menuntut efisiensi dan profesionalisme.</span><span style=\"font-size:12.0pt;line-height:125%;font-family:\"Times New Roman\",\"serif\";\nmso-fareast-font-family:\"Times New Roman\"\"></span></p>', 'http://corporate.sinergiadhikarya.co.id/', 'training-management', 1, 2, '2020-07-06 00:40:31', '2020-07-06 00:41:21');

